import { NgModule } from '@angular/core';

import { SharedModule } from 'app/shared/shared.module';

import { OverpaymentComponent } from './overpayment.component';
import { OverpaymentRoutingModule } from './route/overpayment-routing.module';
import { PanelModule } from 'primeng/panel';
import { InputTextModule } from 'primeng/inputtext';
import { ButtonModule } from 'primeng/button';
import { SearchOverpaymentComponent } from './search/search-overpayment.component';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';
import { ParticularsComponent } from './particulars/particulars.component';
import { TabViewModule } from 'primeng/tabview';
import { OverpaymentTabComponent } from './overpayment-tab/overpayment-tab.component';
import { TableModule } from 'primeng/table';
import { RefundHistoryComponent } from './refund-history/refund-history.component';
import { InstalmentTabComponent } from './instalment-tab/instalment-tab.component';
import { ProtectedPayableTabComponent } from './protected-payable-tab/protected-payable-tab.component';
import { DialogModule } from 'primeng/dialog';
import { DropdownModule } from 'primeng/dropdown';
import { ConfirmPopupModule } from 'primeng/confirmpopup';
import { ConfirmationService, MessageService } from 'primeng/api';
import { OverpaymentInfoComponent } from './overpayment-info/overpayment-info.component';
import { InputNumberModule } from 'primeng/inputnumber';
import { OverlayPanelModule } from 'primeng/overlaypanel';
import { NspConfirmationService } from 'app/shared/confirm/nsp-confirm.service';
import { OverpaymentService } from './service/overpayment.service';
import { DialogService } from 'primeng/dynamicdialog';
import { MipsUploadHistoryComponent } from './mips-upload-history/mips-upload-history.component';
import { RippleModule } from 'primeng/ripple';
import { MipsUploadApprovalComponent } from './mips-upload-approval/mips-upload-approval.component';
import { IcCodeService } from 'app/ng-connect';
import { ApproveRefundComponent } from './approve-refund/approve-refund.component';
import { CheckboxModule } from 'primeng/checkbox';
import {InstalmentModule} from "app/payment/instalment/instalment.module";
import { MessagesModule } from 'primeng/messages';
import { MessageModule } from 'primeng/message';

@NgModule({
  imports: [
    SharedModule,
    OverpaymentRoutingModule,
    PanelModule,
    InputTextModule,
    InputNumberModule,
    ButtonModule,
    FormsModule,
    ReactiveFormsModule,
    TabViewModule,
    TableModule,
    DialogModule,
    DropdownModule,
    ConfirmPopupModule,
    OverlayPanelModule,
    RippleModule,
    CheckboxModule,
    MessageModule,
    MessagesModule,
    InstalmentModule
  ],
  declarations: [
    OverpaymentComponent,
    SearchOverpaymentComponent,
    ParticularsComponent,
    OverpaymentTabComponent,
    RefundHistoryComponent,
    InstalmentTabComponent,
    ProtectedPayableTabComponent,
    OverpaymentInfoComponent,
    MipsUploadHistoryComponent,
    MipsUploadApprovalComponent,
    ApproveRefundComponent
  ],
  providers: [
    ConfirmationService,
    MessageService,
    OverpaymentService,
    NspConfirmationService,
    DialogService,
    IcCodeService
  ]
})
export class OverpaymentModule {
}
